new FileVisitor<>() {

    @Override
    public FileVisitResult preVisitDirectory(Path dir, BasicFileAttributes attrs) throws IOException {
        if (dir.toString().endsWith(".java")) {
            File[] files = dir.toFile().listFiles();
            if (files == null)
                return FileVisitResult.CONTINUE;
            File base = null, ours = null, theirs = null, resolve = null;
            for (File f : files) {
                String name = f.getName();
                switch(name) {
                    case "base.java":
                        base = f;
                        break;
                    case "ours.java":
                        ours = f;
                        break;
                    case "theirs.java":
                        theirs = f;
                        break;
                    case "resolve.java":
                        resolve = f;
                        break;
                }
            }
            if (base != null && ours != null && theirs != null && resolve != null) {
                File conflict = new File(dir.toString(), "conflict.java");
                if (conflict.exists())
                    if (!conflict.delete()) {
                        logger.warn("file failed to be deleted");
                    }
                Files.copy(ours.toPath(), conflict.toPath());
                // KEY: 会直接将冲突写入 conflict 文件
                //logger.info("git merge-file --diff3 {} {} {}", conflict.getPath(), base.getPath(), theirs.getPath());
                ProcessBuilder pb2 = new ProcessBuilder("git", "merge-file", "--diff3", conflict.getPath(), base.getPath(), theirs.getPath());
                try {
                    pb2.start().waitFor();
                } catch (InterruptedException e) {
                    e.printStackTrace();
                }
            }
        }
        return FileVisitResult.CONTINUE;
    }

    @Override
    public FileVisitResult visitFile(Path file, BasicFileAttributes attrs) {
        return FileVisitResult.CONTINUE;
    }

    @Override
    public FileVisitResult visitFileFailed(Path file, IOException exc) {
        return FileVisitResult.CONTINUE;
    }

    @Override
    public FileVisitResult postVisitDirectory(Path dir, IOException exc) {
        return FileVisitResult.CONTINUE;
    }
}

